A representation of the XML 
<code>Manifest</code> element as defined in the 
<a href="http://www.w3.org/TR/xmldsig-core/"> W3C Recommendation for XML-Signature Syntax and Processing</a>. The XML Schema Definition is defined as: 
<pre><code>
 &lt;element name="Manifest" type="ds:ManifestType"/&gt;
   &lt;complexType name="ManifestType"&gt;
     &lt;sequence&gt;
       &lt;element ref="ds:Reference" maxOccurs="unbounded"/&gt;
     &lt;/sequence&gt;
     &lt;attribute name="Id" type="ID" use="optional"/&gt;
   &lt;/complexType&gt;
 </code></pre> A 
<code>Manifest</code> instance may be created by invoking one of the 
<a href="XMLSignatureFactory.html#newManifest(java.util.List)"><code>newManifest</code></a> methods of the 
<a href="XMLSignatureFactory.html" title="class in javax.xml.crypto.dsig"><code>XMLSignatureFactory</code></a> class; for example: 
<pre>   XMLSignatureFactory factory = XMLSignatureFactory.getInstance("DOM");
   Reference ref = factory.newReference("#reference-1", DigestMethod.SHA1);
   List&lt;Reference&gt; references = Collections.singletonList(ref);
   Manifest manifest = factory.newManifest(references, "manifest-1");
 </pre>
